using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct EnemyComponentResolver : IResolver<EnemyComponent>, IResolver<EnemyComponentResolver,EnemyComponent>, IData	{		public EnemyComponentResolver In(ref EnemyComponent enemycomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<EnemyComponent>();			Out(ref local);		}		public void Out(ref EnemyComponent enemycomponent)		{		}	}}